import React from "react";
import { 
  BrowserRouter as Router, 
  Switch, 
  Route, 
  Redirect, 
} from "react-router-dom"; 
  
import Header from "./Header";
import HomeContent from "./HomeContent";
import HomeFooter from "./HomeFooter";

function Mainpage() {
  return (
    
      <div className="App">
        <Header />
        <HomeContent />
        <HomeFooter />
      </div>
    
  );
}

export default Mainpage;
